package createform

import (
	"strings"
	"time"
)

func banner(title string, amber bool) string {
	tlp := "<div class=\"amber\">TLP: AMBER</div>"
	if amber == false {
		tlp = "<div class=\"green\">TLP: GREEN</div>"
	}

	return `
<div class="header">
<div class="centered"><img src="data:image/png;base64," alt="logo" /></div>
	<div>
		<p>
			<div class="green">
				UNCLASSIFIED//FOUO
				<br>
				Protected By N.C.G.S. 132-6.1C
			</div>` + tlp +
		`</p>
		<h2>CYBER SECURITY RESPONSE FORCE</h2>
		<h2>` + strings.ToUpper(title) +
		`</h2>
	</div>
	<div></div>
</div>
<hr>
`
}

func cover(title string) string {
	return `
<div class="header">
<div class="centered"><img src="data:image/png;base64," alt="logo" /></div>
	<div>
		<h1 class="title">` + title +`</h1>
		<hr class="title-bar">
		<h1>Appendix G - Open-Source Exposure Report</h1>
	</div>
	<div></div>
</div>
<hr>
`
}

func footer(amber bool) string {
	if amber {
		return "Recipients may share TLP:AMBER information with members of their own organization and its clients on a need-to-know basis to protect their organization and its clients and prevent further harm."
	} else {
		return "Recipients may share TLP:GREEN information with peers and partner organizations within their community, but not via publicly accessible channels. Unless otherwise specified, TLP:GREEN information may not be shared outside of the cybersecurity or cyber defense community."
	}
}

func styles() string {
	return `<style>
body {
	word-break: break-word;
}
.header {
	text-align: center;
	display: grid;
	grid-template-columns: 20% 1fr 20%;
}
img {
	margin: 0 auto;
	width: 150px;
	height: 150px;
}
.amber {
	color: #FFC000;
}
.green {
	color: #33FF00;
}
.centered {
	display: flex;
	justify-content: center;
	align-items: center;
}

h3 {
	background-color: #E0E0E0;
}
.title {
	font-size: 3em;
}
.title-bar {
	border: none;
    height: 5px;
    background-color: #1E90FF;
}
table {
    border-collapse: collapse;
    width: 100%;
}
table, th, td {
    border: 2px solid black;
    text-align: center;
}
th {
    background-color: #081c4c;
    color: white;
    padding: 4px;
}
</style>`
}

func getAlertId(formNumber string) string {
	return time.Now().Format("20060102") + formNumber
}

